import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faChevronRight } from "@fortawesome/free-solid-svg-icons";
import { faEnvelope } from "@fortawesome/free-regular-svg-icons";

const OverView = () => {
  return (
    <div className="overView">
      <div className="overView__widgets">
        <div className="widgets__personal">
          <div className="widgets__personal--avatar" />
          <div className="widgets__personal--text">
            <h1>Janneke Coumans</h1>
            <p>Front-end Developer</p>
            <FontAwesomeIcon icon={faChevronRight} />
          </div>
        </div>
        <div className="widgets__skills">
          <h1>Skills</h1>
          <p>Always actively skillbuilding</p>
          {/* TODO: Add piecharts for skills */}
        </div>
        <div className="widgets__social">
          <h1>Social Links</h1>
          <p>Some of my professional profiles</p>
          {/* TODO: Add social icons */}
        </div>
        <div className="widgets__email">
          <div className="widgets__email--icon">
            <FontAwesomeIcon icon={faEnvelope} />
          </div>
          <div className="widgets__email--text">
            <p>
              Want to get in touch with me? <span>Iâ€™d love that!</span> Send me
              an email and i will get back to you ASAP.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default OverView;
